import React from 'react';
import Similar from './Similar';
import web from '../src/images/about.svg' 

const About = () => {
    return (
        <>
            <Similar
                name='Welcome to About us page'
                visit='/contact' 
                buttonName="Contact Us" 
                imgSrc='web'
            />
        </>
    );
}

export default About;
